import React from 'react';
import './Project.css';
import '../ImagesLogo'

function Project() {
  return (
    <div className='projects'>
        <div className="project-title">
            <h1>Projects</h1>
        </div>
        <div className="project-all" >
            {projectdata.map((h,id)=>{<img key={h.id}/>})}
        </div>
    </div>
  )
}

const projectdata=[
    {id:1,
    img:''
    }
    ]

export default Project
